어딜가면 TV마다 이재명 얘기다. 이재명 때문에 시끄러우면 시끄러울수록 그이유는 다묻히고 결국은 '난놈은 난놈이여'만 남는다. 삼류정치건달 로저스톤이 그랬지, '악명이 무명보단 낫다, 방어는 필요없다, 오로지 공격만하라.' 로저스톤 찜쪄먹는 이재명. 참 보통일이 아니다. 불길하고 우울하다.
